import React from 'react';

function BotProfile({ bot }) {
  return (
    <div>
      <h3>{bot.name}</h3>
      <p>Power: {bot.power}</p>
      <p>Speed: {bot.speed}</p>
      {/* Add more details as needed */}
    </div>
  );
}

export default BotProfile;
